/*Popper*/

#popper-popup {
  display: none;
  transition: all 1s ease-out;
  background: #333;
  color: white;
  font-weight: bold;
  padding: 20px;
  font-size: 13px;
  border-radius: 4px;
  display: none;
  width: 100%;
  max-width: 400px;
}
#popper-popup a {
  font-size: 16px;
  transition: all 1s ease-out;
  font-weight: 300;
  display: block;
  padding: 20px;
  color: #ffffff;
  text-align: center;
  text-decoration: none;
  text-transform: uppercase;
  transition: all 1s ease-out;
}
#popper-popup a:hover {
  background: #444444;
  transition: all 1s ease-out;
}
#popper-popup[data-popper-reference-hidden] {
  visibility: hidden;
  pointer-events: none;
  transition: all 1s ease-out;
}
#popper-popup[show-popper] {
  display: block;
  z-index: 9999;
  transition: all 1s ease-out;
}

/*keep popper visible in the Divi Builder for editing*/
#et-fb-app #popper-popup {
  display: block;
  transition: all 1s ease-out;
}

/*build the arrow targeting the divider with class 'popper-arrow'*/
#popper-arrow,
#popper-arrow::before {
  transition: all 1s ease-out;
  position: absolute;
  width: 8px;
  height: 8px;
  background: #333333;
}
#popper-arrow {
  visibility: hidden;
  transition: all 1s ease-out;
}
#popper-arrow::before {
  visibility: visible;
  content: "";
  transform: rotate(45deg);
  transition: all 1s ease-out;
}

